impl StatusMessage { pub fn set_status(&mut self, message: Message) { let account_id = env::signer_account_id(); self.records.insert(&account_id, &message); } pub fn get_status(&self, account_id: AccountId) -> Option<Message> { self.records.get(&account_id) }
